import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div className="home">
      <h1>Welcome!</h1>
      <h3>Tell </h3>
      <div className="buttons">
        <Link to="/Auth">
          <button>Admin</button>
        </Link>
        <Link to="/App">
          <button>User</button>
        </Link>
      </div>     
    </div>
  );
}

export default Home;
